def hex2chr(s):
    ret=0
    for i in s:
        ret=(ret<<4)+int(i,16)
    return chr(ret)

def hex2utf8(s):
    s=s[1:].split('%')
    ret=b''
    for i in s:
        ret+=chr(16*(int(i[0],16))+int(i[1],16)).encode('latin1')
    return ret.decode('utf-8')

