def is_space(s):
    if s==' ' or s=='\t' or s=='\r' or s=='\f' or s=='\n':
        return True
    else:
        return False
def is_alpha(s):
    if (s>='a' and s<='z') or (s>='A' and s<='Z'):
        return True
    else:
        return False
    
def str2abs(s):
    global dataDict
    global emojiDict
    global absDict
    global hasInit

    if not hasInit:
        hasInit=True
        init_data()
    
    #split s to word
    wordList=[]
    i=0
    while True:
        if i == len(s):
            break
        if isDebug:
            print(s[i])
        if ord(s[i])>255:
            #not ascii
            if s[i] in dataDict:
                tmp=[]
                tmp.append(s[i])
                tmp.append(dataDict[s[i]])
                wordList.append(tmp)
            else:
                #other language
                wordList.append(s[i])
            
        elif is_alpha(s[i]):
            #english word
            j=i
            while j<len(s) and is_alpha(s[j]):
                j+=1
            wordList.append(s[i:j])
            i=j-1
        else:
            wordList.append(s[i])
        i+=1
    i=0
    absList=[]
    if isDebug:
        print('wordList: ')
        print(wordList)
    while True:
        if i==len(wordList):
            break
        if type(wordList[i])==list:
            #chiness
            conNum=1
            j=i+1
            conPyList=[wordList[i][1]]
            while j<len(wordList) and type(wordList[j])==list:
                conPyList.append(wordList[j][1])
                j+=1
                conNum+=1
            if isDebug:
                print('conPyList:')
                print(conPyList)
            while True:
                if conNum<=0:
                    break
                tmp=''.join(conPyList[:conNum])
                if tmp in absDict:
                    break
                else:
                    conNum-=1
            if not conNum == 0:
                absList.append(absDict[tmp])
                i+=conNum-1
            else:
                absList.append(wordList[i][0])
        else:
            #else
            if wordList[i] in absDict:
                absList.append(absDict[wordList[i]])
            else:
                absList.append(wordList[i])
        i+=1
    #get the final result with a random way
    ret=''
    for i in absList:
        if type(i)==list:
            repDict=i[int(random()*10000)%len(i)].copy().popitem()
            ret+=emojiDict[repDict[0]]*repDict[1]
        else:
            ret+=i
    return ret

